interface ResultType {
  category: string;
  type: string;
  difficulty: string;
  question: string;
  correct_answer: string;
  incorrect_answers: string[];
}

export type TriviaApiResult = ResultType[];

export enum Category {
  GENERAL = "General Knowledge",
  BOOKS = "Entertainment: Books"
}
